function Index({fruits}){
    return(
        <div>
            <h1>Index</h1>
            {fruits.map((fruit,i)=>
            <div key={i}>
            <a href={`/fruits/${i}`}>{fruit.name}</a>
            </div>
            )}
            <a href="/meats"><button>Meats</button></a>
            <a href="/vegetables"><button>Vegetables</button></a>
            <a href="/fruits/new"><button>Add to this list</button></a>
        </div>
    )
}
export default Index;

